 * Main App component
 * Root component that manages routing and global state
 */

import React from 'react';
import Home from './pages/Home';

function App() {
  return (
    <div className="App">
      <header>
        <h1>Explain My Confusion</h1>
        <p>Educational Diagnostic Tool</p>
      </header>
      <main>
        <Home />
      </main>
    </div>
  );
}

export default App;
